import './App.css';
import { CustomRouter } from './components/CustomRouter.js'
import { Header } from './components/Header'
import { Nav } from './components/Nav'

function App() {
  return (
    <div className="App">
      <Header />
      <Nav />
      <CustomRouter />
    </div>
  );
}

export default App;
